function TempVsTime(a){var t=[];for(graphData=JSON.parse(a),i=0;i<graphData.sensor.length;i++){var e=[],r=[];for(j=0;j<graphData.size;j++)graphData.sensor[i][j][1]<160&&(r.push(graphData.sensor[i][j][0]),e.push(graphData.sensor[i][j][1]));var o={y:e,x:r,marker:{size:12},mode:"lines",type:"scatter",name:graphData.text[i]};t.push(o)}var s={yaxis:{showgrid:!1,title:"Temperature"},xaxis:{showgrid:!1,title:"Time"},title:"Temperature VS Time"};Plotly.newPlot("tempVsTimePlot",t,s)}function avgTemp(a){dbJSON=JSON.parse(a);var t=[];for(i=0;i<dbJSON.size.length;i++){var e={y:[dbJSON.avgTemp[i],dbJSON.errMax[i],dbJSON.errMin[i]],type:"box",name:dbJSON.avgChan[i]};t.push(e)}var r={title:"Average Temperature"};Plotly.newPlot("avgTempPlot",t,r)}function sheetContour(a){graphData=JSON.parse(a);var t=[{x:graphData.x,y:graphData.y,z:graphData.z,type:"contour"}],e={title:"Contour"};Plotly.newPlot("contourPlot",t,e)}function SheetBowContour(a){graphData=JSON.parse(a);var t=[{x:graphData.x,y:graphData.y,z:graphData.z,type:"contour"}],e={title:"Bow"};Plotly.newPlot("bowPlot",t,e)}function sheetMesh(a){graphData=JSON.parse(a);var t=[{x:graphData.x,y:graphData.y,z:graphData.z,type:"mesh3d",opacity:.8,color:"rgb(171,154,164)"}],e={title:"Mesh"};Plotly.newPlot("meshPlot",t,e)}function thickVsDate(a){graphData=JSON.parse(a);var t={xaxis:{showgrid:!1},title:"Sheet Thickness VS Date"},e=[{x:graphData.x3,y:graphData.y3,text:graphData.name3,name:"3 Ply",marker:{size:12,color:"red"},mode:"markers",type:"scatter"},{x:graphData.x8,y:graphData.y8,text:graphData.name8,name:"8 Ply",marker:{size:12,color:"blue"},mode:"markers",type:"scatter"}];Plotly.newPlot("thicknessPlot",e,t)}function massVsDate(a){graphData=JSON.parse(a);var t={xaxis:{showgrid:!1},title:"Sheet Mass VS Date"},e=[{x:graphData.x3,y:graphData.y3,text:graphData.name3,name:"3 Ply",marker:{size:12,color:"red"},mode:"markers",type:"scatter"},{x:graphData.x8,y:graphData.y8,text:graphData.name8,name:"8 Ply",marker:{size:12,color:"blue"},mode:"markers",type:"scatter"}];Plotly.newPlot("massPlot",e,t)}